import React from 'react'
import styled from "styled-components";

const StyledBanner = styled.div`
width: fit-content;
background-color: #FF6060;

padding-left: 20px;
padding-right: 20px;
border-radius: 20px;

`

export default function Tag() {
  return (
    <StyledBanner>Tag</StyledBanner>
  )
}
